import React from 'react'
import Topbar from './Topbar';

const style = {
    h1: {
      marginTop: '3em',
    },
    h2: {
      margin: '4em 0em 2em',
    },
    h3: {
      marginTop: '2em',
      padding: '2em 0em',
    },
    last: {
      marginBottom: '300px',
    },
  }

const Home = props => {

    return (
        <div>
            <Topbar />
            <div>
            </div>
        </div>
    )
}

export default Home;
